// src/App.js

import React, { Component } from 'react';

class App extends Component {

  constructor(props) {
    super(props);

    this.state = {
        locales: [],
    };
  }

  componentDidMount() {
    fetch('/api/v1/locales')
        .then(res => res.json())
        .then(data => this.setState({ locales: data.content }));
  }

  render() {
    const { locales } = this.state;

    return (
        <div>
          <center><h1>Locale List</h1></center>
          {locales.map(locale => (
            <div class="card">
              <div class="card-body">
                <h5 class="card-title">{locale.name}</h5>
                <h6 class="card-subtitle mb-2 text-muted">{locale.code}</h6>
                <p class="card-text">{locale.code}</p>
              </div>
            </div>
          ))}
        </div>
    );
  }
}

export default App;
